import React, {Component} from 'react';

class ListUserComponent extends Component{

    constructor(props){
        super(props)
        this.refreshUsers = this.refreshUsers.bind(this)
    }
    render(){
        return(
            <div className="container">
                <h3>All Users</h3>
                <div className="container">
                    <table className="table">
                        <thead>
                            <tr>
                                <th>User name</th>
                                <th>Full name</th>
                                <th>Cell phone</th>
                                <th>Email</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>

                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }
}

export default ListUserComponent
